import React from "react";

const Settings = () => {
  return (
    <Container>
      <Title>Settings</Title>
      <Wrapper>
        <Menu>
          <MenuList>
            <MenuItem>
            <i className="fa-sharp fa-regular fa-roller-coaster"></i>

            </MenuItem>
          </MenuList>
        </Menu>
      </Wrapper>
    </Container>
  )
}

export default Settings;
